\u0412\u043e\u043f\u0440\u043e\u0441 9.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
"Вознесся выше он главою непокорной Александрийского столпа";
Александрийский столп - памятник в честь победы Александра I над
Наполеоном.

\u0412\u043e\u043f\u0440\u043e\u0441 45.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
За каждый названный праздник священник вырывал у своего соперника волос;
назвав день всех святых, православный священник вырвал у католического
целый пучок волос с макушки.

\u0412\u043e\u043f\u0440\u043e\u0441 29.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
В отрывке из "Клятвы Гиппократа" пропущено "смертельного средства";
противник этого положения - недавно скончавшийся Джек Кеворкян,
популяризатор эвтаназии.
